  selector: 'app-cardlist',
  templateUrl: './cardlist.component.html',
  styleUrls: ['./cardlist.component.css']
})
export class CardlistComponent {

  constructor(private _gifsService:GifsService) {}

  public getGifs() : Gif[] {
    return this._gifsService.Gifs;
  }

}
